// Home.js (inside components directory)
import React from 'react';
// import HeroImage from '../assets/group.jpg'; // Example path to hero image
// import WinnersImage from '../assets/winners.jpg'; // Example path to winners image

const Home = () => {
    return (
        <div class="min-h-screen flex flex-col justify-center items-center">
        <div class="max-w-3xl mx-auto px-4 text-center">
            <h1 class="text-4xl font-bold text-gray-900 mb-8">Callaway Golf Scoring App</h1>
            <p class="text-lg text-gray-700 mb-8">Welcome to the Callaway Golf Scoring App, your ultimate companion
                for tracking scores and managing your golf rounds effortlessly.</p>
            <div class="space-y-4">
                <button href="#" class="bg-blue-500 hover:bg-blue-600 text-white py-3 px-6 rounded-lg shadow-md transition duration-300 ease-in-out inline-block">Enter a Round</button>
                <button href="#" class="bg-gray-500 hover:bg-gray-600 text-white py-3 px-6 rounded-lg shadow-md transition duration-300 ease-in-out inline-block">Check out Leaderboard</button>
            </div>
        </div>
    </div>
    );

};

export default Home;
